import React, { Component } from 'react'
import { Card, Button, Table, Space } from 'antd'
import {
    PlusOutlined
} from '@ant-design/icons';
import LinkButton from '../../components/LinkButton';
import MyNavLink from '../../components/MyNavLink'

export default class PlatForm extends Component {
    render() {

        const columns = [
            {
                title: '手机号',
                dataIndex: 'phone',
                key: '1',
                align: 'center',
            },
            {
                title: '姓名',
                dataIndex: 'name',
                key: '2',
                align: 'center',
            },
            {
                title: '状态',
                dataIndex: 'state',
                key: '3',
                align: 'center',
            },
            {
                title: '操作',
                key: '4',
                render: () => (
                    <Space size="middle">
                        <LinkButton>编辑</LinkButton>
                    </Space>
                ),
                align: 'center'
            },
        ];

        const data = [
            {
                key: '1',
                phone: '123456',
                name: '李四',
                state: '启用',
            },
        ]
        return (
            <div>
                <div>
                    <Card
                        title={<span style={{ fontSize: '30px' }}>平台用户</span>}
                        extra={
                            <Button icon={<PlusOutlined />} type="primary" >新增</Button>
                        }
                    >
                        <Table
                            columns={columns}
                            dataSource={data}
                            bordered
                            rowKey="key"
                            pagination={false}
                        />
                    </Card>
                </div>
            </div>
        )
    }
}
